pragma solidity >=0.5.0 < 0.9.0;

contract Demo {
    // bytes array -> dynamic size byte array

    // bytes public b ; // 0x

    bytes public b = "abc";

    // Every elemnts of byte array -> 1 byte or 2 hexac
    function get_element(uint e) public view returns(bytes1) {
        return b[e];
    }
}
